import React from 'react';
import { FaAnchor } from "react-icons/fa";
import { IconContext } from "react-icons";
import {Link} from 'react-router-dom';
import { AiOutlineSetting,AiOutlineBulb,AiOutlineCloudSync } from "react-icons/ai";
import  {Main,MainGrid} from './Brand.elements';
import tata from '../../images/tata.jpg';
import {motion} from 'framer-motion'
const descriptionMotion = {
    rest: {
      opacity:0,
        y: 30,
      transition: {
        duration: 0.4,
        type: "tween",
        ease: "easeOut"
      }
    },
    hover: {
     opacity:0.6,
      y: -15,
      transition: {
        duration: 0.4,
        type: "tween",
        ease: "easeIn"
      }
    }
  };
  
  const logoMotion = {
    rest: { opacity: 1,y:20, duration:0.8, type: "tween", ease: "easeIn" },
    hover: {
      opacity: 0,
      y:-30,
      transition: {
        duration: 0.4,
        type: "tween",
        ease: "easeIn"
      }
    }
  };
  const headingMotion = {
    rest: { opacity: 0.6,y:30, ease: "easeOut", duration: 0.2, type: "tween" },
    hover: {
      opacity: 1,
      y:-20,
      transition: {
        duration: 0.4,
        type: "tween",
        ease: "easeIn"
      }
    }
  };
function Aboutus() {
    return (
        <IconContext.Provider value={{ color: "blue", size:'50' }}>
        <Main>
            <MainGrid  >
                    <motion.img initial={{x:0}} animate={{x:-40}} src={tata} style={{height:'100px',width:'150px'}}></motion.img>
                    <img src={tata} style={{height:'100px',width:'150px'}}></img>
                    <img src={tata} style={{height:'100px',width:'150px'}}></img>
                    <img src={tata} style={{height:'100px',width:'150px'}}></img>
                    <img src={tata} style={{height:'100px',width:'150px'}}></img>
                    <img src={tata} style={{height:'100px',width:'150px'}}></img>
                  
            </MainGrid>
        </Main></IconContext.Provider>
    )
}

export default Aboutus
